import React from 'react';
import ProductList from '../components/ProductList';

export default function ProductsPage(){
  return (
    <div className="page container">
      <header className="page-header">
        <h1>All Products</h1>
        <p>Browse all available items.</p>
      </header>

      <section>
        <ProductList />
      </section>
    </div>
  );
}
